import React, { Component } from 'react';
import './css/Home.css';

export class Home extends Component {

    render() {

        const data = this.props.items.phones.slice(0,3).map(phones =>{
            return <div key = {phones.id}>
            <h3> {phones.brand}</h3>
            </div>
        })
        
        return (
            <div className="home">
                <div className="row"></div>
                {data}

            </div>

        )
    }
}

export default Home;
